import React, { useEffect } from 'react'

const App = () => {

 const fetchData = async () => {
   const response = await fetch('https://dummyjson.com/products');
   const data = await response.json();
   console.log(data);
  }

  useEffect(() => {
    fetchData();
  }, [])
  
  return (
    <div>App</div>
  )
}

export default App
